      "type": "animated-series",
      "typeNumber": 5,
      "year": 2023,
      "description": "В волшебном мире Великого края человечество ничтожно мало, но не падает духом, сражаясь с монстрами и стихиями. Повелитель людей Шэньнун и его народ, а также племена соседнего Северного края развиваются благодаря магии. Противоречивая Звёздная Богиня одновременно угнетает людей и помогает им выжить в суровых условиях. Противостоять небожительнице и искать справедливости готов только один человек — молодой господин по имени У Ван. Когда перед его соплеменникам нависает угроза уничтожения, парень решает пойти на всё ради защиты края, и никакие бессмертные существа и мощные заклинания ему не страшны.",
