      "name": "Хранители Кью",
      "alternativeName": "Xuan dou xiao Q",
      "type": "animated-series",
      "typeNumber": 5,
      "year": 2019,
      "description": "В далекой-далекой пустыне стоит красивый город Кью-Таун, оазис в котором является единственным источником воды. Счастливые и беззаботные жители находятся под защитой Звездной Лиги Кью и ее отважных героев — Флейма, Сандера, Шайна, Айрона и Флеша. Но мирной жизни Кью-Тауна начинает угрожать Банда Бастеров — Циклон, Фантом и Снэп. Они пробрались в город, чтобы украсть запасы воды, электричества и запчастей. Но Звездная Лига Кью всегда будет рядом, чтобы защитить мир и свободу Кью-Тауна.",
      "shortDescription": "Звездная Лига мешает банде злодеев украсть ресурсы у города-оазиса. Супергеройский экшен в пейзажах пустыни",
