      "name": "Красная Поляна",
      "alternativeName": null,
      "type": "tv-series",
      "typeNumber": 2,
      "year": 2025,
      "description": "Обаятельная светская авантюристка Саша сбегает из Москвы в Красную Поляну, где её манит соседство моря и гор, пальм и снегов, амбициозных мажоров и безбашенных экстремалов. В попытке обустроиться на новом месте и поживиться на расслабленных отпускниках она тут же попадает в лапы начальника службы безопасности курорта — Михалыча. Чтобы сохранить свободу, Саша вынуждена подружиться с персоналом отеля и казино и, став одной из них, вычислить коварных шантажистов, которые заставляют управляющего плясать под свою дудку. Она сбежала от одних проблем, чтобы нарваться на ещё большие и в итоге сделать главный выбор своей жизни: свобода и финансовая независимость или любовь и друзья, которых у неё никогда не было.",
      "shortDescription": "Столичная мошенница разоблачает бандитов на олимпийском курорте. Смотрим тизер авантюрной комедии",
