      "description": "Добро пожаловать в фотостудию «Время», скрытую посреди шумного мегаполиса. В ней работают трое друзей Чэн Сяоши, Лу Гуан и Цяо Лин, которых смело можно называть агентами времени. Они обладают фантастической способностью перемещаться внутрь фотографий и менять прошлое по заказу клиентов, которые хотят что-то исправить в своей жизни. На это у друзей есть только 12 часов и ни одного шанса на ошибку, также важно не нарушать хрупкий баланс реальности, ведь игры со временем опасны.",
