      "alternativeName": null,
      "enName": null,
      "type": "movie",
      "typeNumber": 1,
      "year": 2021,
      "description": "В Санкт-Петербурге на сегодняшний день около сотни спортивных клубов, в которых обучают боксу или всевозможным его разновидностям. Заниматься там может любой, вне зависимости от возраста или пола. Что же заставляет уже взрослых и сформировавшихся людей выходить на ринг и участвовать в подобных турнирах? В случае с профессиональными спортсменами это объяснимо желанием высоких достижений, славы, денег, в конце концов, это их работа. Но каковы мотивы тех, кто не зарабатывает на этом денег, ну, или деньги в их случае не главное? Что движет теми, кто не ищет славы, и кто, заявляясь на участие, знает, что не победит? Что получают они взамен от своего труда на тренировках, от синяков и ссадин на турнирах?",
