      "type": "anime",
      "typeNumber": 4,
      "year": 2007,
      "description": "В конце 90-х серия до ужаса похожих самоубийств не сходит с передовиц японских газет. У всех смертей, помимо нескольких странных сходств, есть одна деталь, которая выделяется среди остальных: все жертвы покончили с собой, спрыгнув со здания Фудзё. Сики Рёги, наделённая сверхспособностями, подозревает, что эти зловещие события имеют сверхъестественную причину. Она приступает к расследованию вместе с детективом и специалисткой в магии Токо Аодзаки, а также своим другом Микией Кокуто. Сики путешествует по загадочному миру, чтобы раскрыть тёмные тайны, окружающие это пугающее явление.",
