      "name": "Поиск по архивам: Как найти своё прошлое",
      "alternativeName": null,
      "enName": null,
      "type": "movie",
      "typeNumber": 1,
      "year": 2024,
      "description": "Cервис Яндекса «Поиск по архивам» помогает быстро находить имена и фамилии в рукописных документах XVIII — начала XX века. Чтобы распознавать и переводить старинные рукописи в понятный текст, он использует нейросети.\nКоманда и пользователи сервиса, генеалоги-эксперты и сотрудники архивов рассказывают, как люди восстанавливают свои родословные и почему с помощью технологий делать это стало проще.",
      "shortDescription": "Как разобраться в старинных документах и узнать о своих предках? Док о роли ИИ в работе нового сервиса Яндекса",
