      "description": "В жизни молодой семьи важное событие — ребёнок впервые идёт в детский сад. Молодая мать, пять лет просидевшая в декретном отпуске, впервые сталкивается с ощущением свободы. Не зная, куда теперь себя применить, она влюбляется. Дочка становится свидетельницей невинного флирта и, неверно истолковав ситуацию, рассказывает всё отцу. Ещё недавно абсолютно счастливая «ячейка общества» начинает рушиться. И молодым родителям приходится повзрослеть, чтобы суметь сохранить семью.",
