      "typeNumber": 5,
      "year": 2024,
      "description": "Мэнь Кэ живет в мире, населенном фантастическими существами. Она — типичная офисная сотрудница, которая изо дня в день делает одну и ту же работу. Но всё резко меняется, когда в девушку вселяется питающийся эмоциями паразит, и если ей станет по-настоящему скучно — она умрет. К счастью, на помощь Мэнь Кэ приходит жизнерадостный инопланетянин Я Сэнь, который будет делать так, чтобы каждый день девушки стал увлекательным и насыщенным событиями.",
      "shortDescription": "Супергерой ежедневно спасает от смерти девушку, которой нельзя скучать. Мультфильм о борьбе с офисной рутиной",
