      "description": "Идет расследование гибели журналистки, которая без ведома редакции занималась частным расследованием об убийстве легендарной актрисы советского кино, а также жены владельца авиаремонтного предприятия, погибшей в смертельном ДТП. Вместо Самойлова новым начальником УВД становится амбициозный и молодой для такой должности Андрей Заморенов. Мила скрывает от всех начавшиеся отношения со Швецом. Но влюбленность дочери не ускользает от проницательного отца.",
