      "description": "Минни и Куинн родились 1 января 1990 года в одной и той же лондонской больнице. Куинн появился на свет на пару минут раньше и получил имя, которым мать Минни собиралась назвать свою дочь. Минни убеждена — вместе с именем он украл и её удачу. Их жизни сложились совершенно по-разному, но годы спустя судьба снова сталкивает их вместе.",
