      "typeNumber": 1,
      "year": 2024,
      "description": "Вас ждут захватывающие приключения начальника сказочной полиции Добрыни и сыщиков детективного агентства «ХРУМ» — школьника Макса и учительницы Марии Петровны. На сей раз весь сказочный мир перевернулся с ног на голову — злодеи прекращаются в добряков, смелые становятся трусливыми, а страшные — красивыми. Сказочная полиция во главе с Добрыней не справляется с наплывом жалоб и обращений. На помощь приходят Мария Петровна и Макс. Детективное агентство «ХРУМ» начинает свою работу!",
