      "description": "Эксклюзивные спортивные автомобили, созданные под индивидуальный заказ вручную, сочетают передовые технологии и элегантность дизайна. Всё о мастерстве и творческом подходе создателей автомобилей премиум-класса, которые работали с такими мировыми брендами, как BMW, Audi, Ferrari и Porsche. Они превращают мечты своих заказчиков в реальность, создавая уникальные автомобили с индивидуальным характером и непревзойденным качеством.",
