      "name": "Искусство обмана",
      "alternativeName": "Los Artistas, primeros trazos",
      "type": "tv-series",
      "typeNumber": 2,
      "year": 2023,
      "description": "Ката, влиятельный арт-эксперт, находится в эмоциональном упадке и близка к профессиональному выгоранию. Красавчик Яго, торговец антиквариатом, продает за большие деньги безделушки неопытным коллекционерам. Их знакомство приводит к неожиданному результату — они решают организовать общее дело. У них нет никаких сомнений, что знания и связи помогут продать миллионерам не один десяток поддельных картин, но в какой-то момент их план превращается в капкан.",
      "shortDescription": "Аферист и арт-дилерша объединяются, чтобы нажиться на подделках. Бойкий испанский сериал с юмором и романтикой",
