      "alternativeName": "Katsute Mahou Shoujo to Aku wa Tekitai shiteita.",
      "type": "anime",
      "typeNumber": 4,
      "year": 2024,
      "description": "Злая организация во главе с офицером Мирой уничтожает всё на своем пути, когда неожиданно против злодеев выступает волшебница Бякуя Мимори. Удивительно, но Мира с первого взгляда в неё влюбляется — теперь в его сердце расцветает чуждая тёмному миру любовь, что порождает конфликт с его убеждениями. Бякуя неустанно сражается за справедливость, а чувства Миры усиливаются, и вот уже злой офицер стоит перед моральной дилеммой.",
      "shortDescription": "Как остаться беспощадным злодеем, если сердце тает от любви? Воздушное и смешное аниме о неловких ухаживаниях",
