      "year": 2023,
      "description": "Независимая и предприимчивая дикая кошка трех лет по имени Линцесса — детеныш северной рыси. Ее дом — загадочный лес, населенный другими животными. Линцесса вместе с братом только начинают знакомиться с окружающим миром и раскрывать секреты жизни в лесу. Линцесса расскажет о своих приключениях и покажет, насколько она бесстрашна и своенравна.",
