      "name": "Край ночи",
      "alternativeName": null,
      "enName": null,
      "type": "movie",
      "typeNumber": 1,
      "year": 2024,
      "description": "В 2020 году режиссер Андрей Натоцинский приехал в Сухум, и город встретил его темнотой: ни на центральной площади, ни вокруг не горели фонари. Узнав, что веерные отключения электричества связывают с криптомайнерами, которых в Абхазию привлекла дешевая электроэнергия, Натоцинский вернулся со съемочной группой. Чтобы разобраться, как устроен контраст между активной добычей криптовалюты и общей разрухой, обрамленной дикими пейзажами, за три года он провел четыре съемочных экспедиции. Однако «Край ночи» — это фильм не о майнерах, вернее, не столько о них, сколько вообще о регионе, который до сих пор не оправился от войны 92-93 годов, последовавших конфликтов и экономической катастрофы. Погружаясь в местную историю, разговаривая с самыми разными людьми, наблюдая приход и уход майнеров, Натоцинский старается создать объективную — насколько это возможно — картину жизни в Абхазии. Режиссер фокусируется на том, чтобы задавать вопросы, отдавая право делать заявления своим героям, и хотя его фильм снят нарочито живописно, чувства, которые он оставляет, вряд ли будут легкими.",
      "shortDescription": "Как Сухум стал центром нелегального майнинга? Пронзительный док об истоках проблемы, погрузившей город во тьму",
