      "description": "Вы могли слышать о проекте «Сад им.» художника и куратора Артема Филатова — открытом мемориальном саде при частном крематории в Нижнем Новгороде. Туда можно прийти ногами, чтобы послушать звуковую инсталляцию или побыть в пространстве тихой рефлексии, а можно посетить это место виртуально — и посвятить одно из растений в саду кому-то из ушедших близких. Артем тесно связывает свою практику с историей Нижнего Новгорода, но при этом ставит вопросы, выходящие за рамки одного города и вообще нашего времени — он стремится создавать искусство, которое говорит о жизни и смерти и устремлено в будущее, по-новому раскрываясь для следующих поколений. В фильме Филатов рассказывает о «Саде» и других своих работах, а также об идеях, стоящих за ними.",
      "shortDescription": "Художники разбивают прекрасный сад во дворе крематория. Док о том, как искусство работает со страхом смерти",
