      "type": "movie",
      "typeNumber": 1,
      "year": 2023,
      "description": "Незрячий пенсионер Илья планирует пробежать марафон за среднее для зрячих атлетов время — четыре с половиной часа. Молодой тренер Дима помогает ему правильно подойти к делу: выдержать темп, рассчитать нагрузку, продержаться до финиша. За 15 минут, которые длится фильм, мы увидим весь диапазон эмоций между ними, от раздражения до искренней поддержки, а также узнаем многое об Илье: к чему он стремится, когда перестал видеть, что в жизни он считает важным, а что — чепухой. Режиссер снимает героев на зернистую черно-белую пленку, перемежая пробежки и разговоры сюрреалистичными, фантазийными портретными кадрами, отделяет диалог от картинки и прошивают фильм пульсирующей звуковой дорожкой, пересобирает материал как коллаж, создавая небанальную и удивительно цельную эстетику. Получается кино, в котором гармонично сложилась редкая комбинация: чувство стиля и чувство юмора, история и портрет, визуальная красота и абсолютно живая фактура.",
      "shortDescription": "Тренер готовит незрячего бегуна к марафону. Захватывающий док с юмором и накалом эмоций",
