      "typeNumber": 1,
      "year": 2024,
      "description": "После освобождения из тюрьмы Кайрат сразу бросается на поиски способа спасти свою больную мать. Диагноз врачей оказывается безжалостным: чтобы спасти жизнь матери, ему необходимо достать дорогостоящее медицинское оборудование из Китая и лекарства на миллион долларов. Без денег и постоянной работы Кайрат обращается за помощью к бывшим олигархам, которые также находятся в тюрьме. Они соглашаются помочь, но с условием: Кайрат должен доставить грузовик зерна в Китай. Встав перед выбором, Кайрат соглашается.\nВ пути через границу Китая Кайрата и его водителя останавливает и нападает неизвестная преступная группа. Они оба оказываются без сознания. Когда Кайрат приходит в себя, он обнаруживает себя в китайской «Школе Кунг-фу». Местный житель объясняет ему, что спас его и водителя, потому что их машина загорелась. Кайрат тут же связывается с олигархами в Казахстане, чтобы сообщить о произошедшем. Они признают, что в пропавшем грузе находилось ценное золото, и требуют его найти, угрожая, что иначе он больше не увидит свою мать. Теперь Кайрату предстоит раскрыть загадку похищения груза. Ему помогают учителя и ученики школы кунг-фу.",
      "shortDescription": "Кайрат познает азы кунг-фу, чтобы спасти мать от бандитов. Лихая комедия, снятая в древнем китайском монастыре",
