      "description": "Хуан Имэй родилась в интеллигентной семье и с самого детства занималась искусствами. На работе её сразу полюбили, там она познакомилась и завела отношения с коллегой, но эта любовь закончилась. Девушка вернулась в университет, окончила его, и вышла замуж за сокурсника. Но молодожёны не сошлись характерами, и в конце концов развелись. Имэй начала заниматься бизнесом и искусством, что позволило ей встретиться с идеальным мужчиной. Однако, и эта любовь оказалась скоротечной. Пережив столько неудачных отношений, девушка не отчаивается и продолжает с оптимизмом смотреть в будущее.",
