      "year": 2023,
      "description": "Фильм рассказывает о русском меценате Савве Мамонтове. Его называли Саввой Великолепным и московским Медичи. В Абрамцеве он создал отдельный мир с идеальными условиями для художников, театралов и просто ценителей искусства. Он первым открыл частную оперу, где продвигал исключительно русских авторов. Савва Мамонтов всю свою жизнь посвятил развитию и культивированию русского искусства. В фильме не просто рассказана биография мецената, но и сделана попытка разгадать феномен Саввы Мамонта, понять мотивы его масштабного меценатства, осознать глобальную миссию этого человека и оценить его вклад в отечественную культуру.",
