      "type": "movie",
      "typeNumber": 1,
      "year": 2022,
      "description": "Фильм посвящен истории русской живописи, ее истокам, главным вехам и основным периодам своего развития. В нем будут освещены разные этапы истории Русской живописи: древнерусский период, затем знакомство России с западной школой живописи и открытие в 1757 году «Академия трех знатнейших художеств»; история XIX столетия, как золотого века русской живописи; несколько периодов ХХ века, когда русская живопись встала на путь отрицания классики и разделения на огромное количество различных течений, затем Советский период, создание в 1932 году Союза художников СССР, художники в годы Великой Отечественной войны, в период оттепели, застоя и перестройки; и, разумеется, современное искусство сегодня, перспективы его развития.",
