      "type": "movie",
      "typeNumber": 1,
      "year": 2023,
      "description": "Фильм посвящен большому пути, который прошла русская музыка в разные периоды истории: от знаменной музыки до произведений современных композиторов. С точки зрения общемировой истории культуры русская классическая музыка в том виде, в котором мы ее знаем сегодня, появилась довольно поздно — в первой половине 19 века. Но появление это имело во всем мире ошеломляющий эффект. Значительная часть повествования посвящена 19 веку и таким величайшим композиторам, как Глинка, Даргомыжский, Чайковский, Бородин, Мусоргский и многим другим. Большое место в фильме занимает ХХ век, подаривший не менее гениальных композиторов: Свиридов, Хачатурян, Прокофьев, Шостакович, Щедрин. Завершает фильм исследование современности.",
