      "type": "movie",
      "typeNumber": 1,
      "year": 2022,
      "description": "Посвящается истории русского театра, его истокам, главным вехам и основным периодам своего развития, его влиянии на страну и мир. В фильме будут освещены разные этапы истории русского театра: истоки в народных балаганных представлениях и мистерии-проповедях; открытие публичных и крепостных театров в России; Александр Островский — основоположник современной русской драматургии; Константин Станиславский — создатель новой школы актерского мастерства; творчество Олега Ефремова, Юрия Любимова, Галины Волчек, Андрея Гончарова и, разумеется, современный театр сегодня, перспективы его развития.",
