      "type": "movie",
      "typeNumber": 1,
      "year": 2024,
      "description": "Большое путешествие в историю, попытка осмыслить, как менялась отечественная архитектура, какие события и личности влияли на эти изменения, и понять с каким багажом мы подошли ко дню сегодняшнему. Что создают современные архитекторы, и какой они видят архитектуру будущего. Мы надеемся, что наш фильм привлечёт внимание не только любителей русского зодчества, но и вызовет интерес у людей пока ещё далёких от яркого многообразия национального архитектурного наследия.",
