      "enName": null,
      "type": "movie",
      "typeNumber": 1,
      "year": 2023,
      "description": "Джеймс Хэмилтон начал свою карьеру в Нью-Йорке в начале 70-х. Он сотрудничал с Harper’s Bazaar, Vanity Fair, Rolling Stone, The New York Observer и 20 лет был штатным фотографом The Village Voice. Хэмилтон снимал абсолютно всех героев американской культуры, от Вуди Аллена и Сюзан Зонтаг до Лу Рида и Джима Джармуша. В фильме Джеймс обсуждает фотографию и журналистику вместе с коллегами и поклонниками, вспоминает о своей удивительной бабушке, на старости лет ставшей популярной актрисой, и травит байки о знаменитостях, например, о том, как уговорил Жана-Люка Годара позировать на балконе небоскреба, хотя тот панически боялся высоты.",
