      "alternativeName": "Citizen Sleuth",
      "enName": null,
      "type": "movie",
      "typeNumber": 1,
      "year": 2023,
      "description": "Эмили Нестор из Западной Виргинии с детства хотела быть похожей на агента Клариссу Старлинг из «Молчания ягнят». Маньяков в ее родном местечке, увы, нет, зато недавно на трассе в странной аварии погибла молодая женщина. Ходят слухи, что это была не авария, а убийство, а полиция то ли плохо сделала свое дело, то ли покрывает преступников. Эмили, до этого работавшая официанткой в стрип-клубе, решает докопаться до правды и запускает собственное расследование в формате подкаста. Ее поддерживает семья погибшей, подкаст выходит в топы, появляются большие рекламные контракты, но спустя время новой звезде тру-крайма придется сделать трудный выбор, который изменит все.",
