      "id": 5516263,
      "name": "CEO будущего",
      "alternativeName": "The Driven Ones",
      "enName": null,
      "type": "movie",
      "typeNumber": 1,
      "year": 2023,
      "description": "Франциска, Тобиас, Сара, Давид и Фредерик — студенты магистратуры швейцарского университета Санкт-Галлена, которую Financial Times назвал «лучшей в мире программой в сфере управления». У каждого свой бэкграунд, но цель у них общая — реализоваться в качестве предпринимателей, консультантов или генеральных директоров. Режиссер на протяжении 7 лет пристально следит за ними: от вступительных собеседований до первых шагов в карьере, от академических успехов до побед и поражений в мире больших денег. Фильм — это вольное рассуждение на тему «Кто хочет стать миллионером?», то есть кем надо быть, чтобы мечтать оказаться на вершине мира.",
      "shortDescription": "Выпускники элитной бизнес-школы строят карьеру в мире больших денег. Пять историй о победах и разочарованиях",
