      "description": "Двое друзей Шерхан и Казанбас приехали в Алмату и занимаются мелким криминалом. Они живут одни днем и прожигают деньги в местном баре. В один из вечеров с ними знакомятся девушки и приглашают к себе. Но это оказывается западней, ведь там их поджидают двое здоровых мужиков и насильно увозят в далекий одинокий дом. Горя-друзья даже приблизительно не понимают, в какой точки страны находятся. \nС этого дня им в течение трех недель нужно лепить пельмени на продажу. Глава предприятия Маке безжалостно затыкает рты всем, кто смеет ему перечить. Шерхан и Казанбас предпринимают пару попыток сбежать, но все они заканчиваются неудачно, и после побегов им постоянно удлиняют срок пребывания. Шерхан не опускает руки, чтобы обрести свободу, но Казанбас своими советами по повышению продаж пельменей завоевывает расположение Маке и хочет остаться. Теперь друзьям нужно не только найти не только выход к воле, но и решить конфликт между собой.",
