      "type": "movie",
      "typeNumber": 1,
      "year": 2020,
      "description": "Обладатель более 61 индивидуальной награды, в том числе рекордных 5 «золотых мячей», Криштиану Роналду стал вторым игроком в истории футбола, получившим наибольшее количество наград. Обладатель более 61 индивидуальной награды, в том числе рекордных 5 «золотых мячей», Криштиану Роналду стал вторым игроком в истории футбола, получившим наибольшее количество наград. Играя с юных лет в Мадейре, Португалия, Роналду сделал карьеру и стал иконой лиссабонского «Спортинга», «Манчестер Юнайтед», мадридского «Реала» и «Ювентуса».",
