      "name": "Парадоксальный лайв",
      "alternativeName": "Paradox Live the Animation",
      "type": "anime",
      "typeNumber": 4,
      "year": 2023,
      "description": "Будущее. В музыке безраздельно правит хип-хоп, а рэперы с помощью особого материала фантометал, который реагирует на ДНК исполнителя, устраивают красочные шоу Phantom Lives, превращая свои эмоции в яркие иллюзии. Однако использование фантометала вызывает сильнейшие переживания прошлых жизненных травм и болезненные воспоминания, что приводит к так называемым ловушечным реакциям. В зависимости от силы эмоций артиста, эти реакции могут ощутимо влиять на психику.\nСпустя 10 лет после закрытия легендарный клуб «Парадокс» вновь открывает двери и объявляет о начале нового конкурса Phantom Live под названием Paradox Live. На кону 10 миллиардов иен, а бороться за приз будут четыре известные рэп-группы.",
      "shortDescription": "Рэп-группы соревнуются на шоу, где их эмоции превращаются в яркие образы. Красочное музыкальное аниме ",
