      "type": "movie",
      "typeNumber": 1,
      "year": 2023,
      "description": "Милая и немного сумасбродная Ирис имеет все, о чем только можно мечтать — безупречный муж, две дочери, собственный стоматологический кабинет, в котором отбоя нет от посетителей, чудесная квартира и верные друзья. Но уже много лет между супругами нет близости. Незнакомка советует героине завести любовника с помощью мобильного приложения. Стоит Ирис пройти регистрацию, как на нее обрушивается дождь из молодых, зрелых, брутальных и романтичных мужчин.",
      "shortDescription": "Замужняя Ирис бежит от скуки, окунаясь в мир онлайн-знакомств. Дерзкий французский ромком о раскрепощении",
