      "year": 2023,
      "description": "Фани уже 30, и она до сих пор одна из-за страха встретить маньяка. Когда у нее появляется сосед, Фани не обращает на него никакого внимания — он настолько неинтересный, что и маньяком его представить трудно. Но его кот начинает говорить с Фани, и к сожалению, слышит его только она. Кот становится ее близким другом, который понимает и поддерживает ее. Теперь её парень — кот.",
