      "typeNumber": 2,
      "year": 2024,
      "description": "В Лиманске погибает мужчина от удара током. Казалось бы, просто несчастный случай. Однако покойный оказывается бывшим мужем Марины Орлинской. И лишь только это дело удается раскрыть, как случается еще одна смерть: паспортистка из ОВД Лиманска умирает в подвале своего дома, отравившись молодым вином. Кажется, опасность ходит вокруг Марины кругами, будто акула, и круги становятся все уже, а неуловимая мафия — все ближе и все реальнее.",
      "shortDescription": "Марина расследует гибель бывшего мужа. Продолжение сериала о приключениях сыщицы в приморском городке",
